import React from "react";
import "./App.css";
import Card from "./Componentes/Card";
import Primera from "./Componentes/primera.jpg";
import Segunda from "./Componentes/segunda.jpg";
import CardDias from "./Componentes/CardDias";

function App() {
  const ejercicios = [
    [
      Lunes= ["Bicicleta","Eliptico","Cinta"],
      Martes= ["Eliptico","Cinta","Sentadillas"],
      Miercoles= ["Bicicleta","Cinta","Sentadillas" ,"Abdominales"],
      Jueves= ["Eliptico","Cinta","Sentadillas" ,"Abdominales"],
      Viernes= ["Eliptico","Sentadillas" ,"Abdominales","Estocadas"],
  ]
  ];
  const imagenes = [
    {
      img: Primera,
      title: "LUNES",
      color: "#00FFFF",
    },
    {
      img: Segunda,
      title: "Martes",
      color: "#00FFFF"
    }
  ];

  return (
    <div>
        {ejercicios.map(card => {
          return (
            <Card
              Lunes={card.Lunes}
              Martes={card.Martes}
              Miercoles={card.Miercoles}
              Jueves={card.Jueves}
              Viernes={card.Viernes}

            ></Card>
          );
        })}
      <div className="cards-container">
      {imagenes.map(card => {
        return (
          <CardDias
          title={card.title}
          color={card.color}
          img={card.img}
          ></CardDias>
          );
        })}
        </div>
    </div>
  );
}

export default App;
